  false,\n\t\"url\": null,\n\t\"notes\": \"This cruise will embark from Balboa, Panama,
  will transit and collect underway data through the Panama Canal toward the primary
  operating area, will focus its scientific objectives on the project operating area
  in British national waters in the vicinity of the Cayman Islands identified as the
  Mid-Cayman Rise, and will transit to Key West, Florida.  Underway data will be collected
  during transit through all coastal states (with permits) with the exception of Columbia
  and Cuba.  Primary mapping, CTD and ROV operations will be conducted in Cayman Island
  waters under British jurisdiction.\",\n\t\"license_title\": null,\n\t\"extras\":
